document.onload = function(e) {

}
document.getElementById("txtPNumber").oninput = function(e) {
    console.log(/[0-9]+/.test(this.value))
    if(/0-9+/.test(this.value) == false) {
        this.classList.add("invalid");
        return false;
    }
    this.classList.remove("invalid");
}
